window.bookSummaryJSON = "<p>Learn about the workings of the Human Body with iMindsJNR audio learning series for younger minds. </p> <p>The human body is more sophisticated than even the best computer. But while scientists know more about the human body than perhaps anything else, there are still mysteries that baffle us. When it comes to the human body, it seems that the more we know, the more we realize we don’t know! </p> <p>The human body is a collection of 100 trillion tiny cells. These are the body’s building blocks. Each cell has the same basic structure: an outer skin, a nucleus, and a jelly-like fluid containing floating organelles. However, there are many different types of cells. There are fat cells, blood cells, brain cells and many more! </p> <p>Perfect to engage, entertain and broaden young thinkers.. iMindsJNR brings knowledge to your MP3 with 5 minute information segments for growing minds. </p> <p>iMindsJNR offers 6 main categories for ages 7-14years including General Knowledge, Geography &amp; Nature, Famous People, Science &amp; Math, The Arts and History. </p> <p>Make your MP3 smarter with iMindsJNR MindTracks, intersperse with music and enjoy learning a little about a lot.. knowledge to help shape young minds. </p>"; 
